import React, { FC } from 'react';
import './styles/component.css';

import Countdown from './Countdown';

const Daily: FC = () => {
    return (
        <div className='info'>
            <div className='display-in-row'>
                <h2>Daily Rotations</h2>
                <Countdown />
            </div>

            <h4>Nightfall</h4>
        </div>
    );
};

export default Daily;
